import './Header.style.scss';
import { lightTheme } from '../../util/icons';

const Header = (props) => {
   console.log(props)
   const{
        ThemeChange
   } = props;
    return(
        <>
            <header className="header">
                <div className="Header-logo">
                    <h1>{('Surya')}</h1>
                </div>
                <div className="Header navbar">
                    <ul className="nav-link">
                        <li>{('Home')}</li>
                        <li>{('About')}</li>
                        <li>{('Skills')}</li>
                        <li>{('Experience')}</li>
                        <li>{('Contact')}</li>
                    </ul>
                    <div className='darkLightTheme' onClick={Them}>
                        {lightTheme()}
                    </div>
                </div>
            </header>
        </>
    );
}

export default Header
